import { Button, Card, Typography, Box, Grid } from "@mui/material";
import { Fragment, useState } from "react";
import UserCard from "./UserCard";
import data from "./data.json"
import "./App.css"



export default function List() {
    const user = data

    const style =

    {
        div: {
            background: "#C8D1DE",
            padding: "10px",
            textAlign: "center",

        },
        div2:{
            padding: "10px",
            textAlign: "center"
        },
        box: {
            justifyContent: "center",
            display: "flex",
            marginTop: "20px",
            background: "#C8D1DE",
            alignContent: "center",
            borderRadius: "20px",
            '&:hover': {
                backgroundColor: '#E63914',
                color: '#E63914',
            }



        }
    }



    return (

        <div style={{height: "100vh", width: "70vw"}}>

            <h1>Socios</h1>
            <Box sx={{ flexGrow: 1 }} style={style.box}>
                <Grid container spacing={2}>

                    <Grid item xs={3}>
                        <div style={style.div2}>
                            Nombre
                        </div>
                    </Grid>
                    <Grid item xs={3}>
                        <div style={style.div2}>
                            Apellido
                        </div>
                    </Grid>
                    <Grid item xs={3}>
                        <div style={style.div2}>
                            DNI
                        </div>
                    </Grid>
                    <Grid item xs={3}>
                        <div style={style.div2}>
                            Fecha Nac.
                        </div>
                    </Grid>
                </Grid>

            </Box>

            {user.map(user => {
                return (

                    <Box sx={{ flexGrow: 1 }} className="box" onClick={() => console.log(user.nombre)}>

                        <Grid container spacing={2}>

                            <Grid item xs={3} >

                                <Typography style={style.div}>
                                    {user.nombre}
                                </Typography>


                            </Grid>

                            <Grid item xs={3}>

                                <Typography style={style.div}>
                                    {user.apellido}
                                </Typography>


                            </Grid>

                            <Grid item xs={3}>

                                <Typography style={style.div}>
                                    {user.dni}
                                </Typography>

                            </Grid>

                            <Grid item xs={3}>

                                <Typography style={style.div}>
                                    {user.fecha}
                                </Typography>

                            </Grid>

                        </Grid>

                    </Box>


                )
            })}

        </div>
    )

}
